    /**
     * 416. Partition Equal Subset Sum
     * 是否可以分成两个subSet 两个子数组和相等
     * input: [1, 5, 11, 5]
     * output: true [1, 5, 5] [11]
     * <p>
     * input: [1, 2, 3, 5]
     * output: false
     * 数组和为偶数,并且找出subSet和等于sum/2
     * 是否存在子数组和为sum/2,不是连续子数组
     *
     * @param nums int[] 正整数数组
     * @return true/false
     */
    public boolean canPartition(int[] nums) {
        int sum = 0;
        for (int n : nums) {
            sum += n;
        }
        System.out.println("sum = " + sum);
        return (sum & 1) != 1 && isEqualSum(nums, sum >> 1);
    }
    
    /**
     * 动态规划,判断数组中是否存在子数组和等于给定的sum
     */
    private boolean isEqualSum(int[] nums, int sum) {
        boolean[] dp = new boolean[sum + 1];
        dp[0] = true;
        for (int n : nums) {
            for (int i = sum; i >= n; i--) {
                dp[i] = dp[i] || dp[i - n];
            }
        }
        return dp[sum];
    }
    
    
    /**
     * 494. Target Sum
     * 数组中每个数字有 + - 符号,找出所有可能使和等于S
     * 找出subSet P和N
     * sum(P) - sum(N) = S
     * sum(P) - sum(N) + sum(p) + sum(N) = S + sum(p) + sum(N)
     * 2 * sum(P) = S + sum(nums)
     * sum(P) = (S + sum(nums)) / 2
     *
     * @param nums int[] 非负整数
     * @param S    int target sum
     * @return int
     */
    public int findTargetSumWays(int[] nums, int S) {
        int sum = 0;
        for (int n : nums) {
            sum += n;
        }
        return sum < S || ((sum + S) & 1) == 1 ? 0 : subsetSum(nums, (sum + S) >>> 1);
    }
    
    /**
     * 返回子数组和等于s的个数
     */
    private int subsetSum(int[] nums, int s) {
        int[] dp = new int[s + 1];
        dp[0] = 1;
        for (int n : nums) {
            for (int i = s; i >= n; i--) {
                dp[i] += dp[i - n];
            }
        }
        return dp[s];
    }
    
    /**
     * 406. Queue Reconstruction by Height
     * 重新排队 数组中(h,k) h人的高度,k是在此人之前大于等于该身高的人数
     * Input: [[7,0], [4,4], [7,1], [5,0], [6,1], [5,2]]
     * Output: [[5,0], [7,0], [5,2], [6,1], [4,4], [7,1]]
     * 最高的人先排序,然后次高的人insert sort,以此类推
     * brilliant solution 先排序height,再根据k insert即可
     *
     * @param people int[][]
     * @return int[][]
     */
    public int[][] reconstructQueue(int[][] people) {
        if (people == null) return null;
        Arrays.sort(people, (o1, o2) -> o1[0] != o2[0] ? o2[0] - o1[0] : o1[1] - o2[1]);
        List<int[]> res = new ArrayList<>();
        for (int[] p : people) {
            res.add(p[1], p);
        }
        return res.toArray(new int[people.length][]);
    }
    
    /**
     * 413. Arithmetic Slices
     * arithmetic 等差数列 至少包含三个元素
     * 找出数组A中 arithmetic 的个数
     * A = [1, 2, 3, 4]
     * return: 3, for 3 arithmetic slices in A: [1, 2, 3], [2, 3, 4] and [1, 2, 3, 4] itself.
     *
     * @param A int[]
     * @return int
     */
    public int numberOfArithmeticSlices(int[] A) {
        if (A.length < 3) return 0;
        int res = 0;
        for (int i = 0; i < A.length - 2; i++) {
            int diff = A[i + 1] - A[i];
            if ((A[i + 2] - A[i + 1]) == diff) {
                res++;
                int j = i + 3;
                while (j < A.length) {
                    //普通解法
                    if ((A[j] - A[j - 1]) == diff) {
                        res++;
                        j++;
                    } else {
                        break;
                    }
                }
            }
        }
        return res;
    }
    
