    /**
     * 419. Battleships in a Board
     * 二维数组由 . 和 X 组成,找出其中 1*N 或者 N*1 组成的battleship,不能有交叉
     * <p>
     * X..X
     * ...X
     * ...X return 2
     * <p>
     * ...X
     * XXXX
     * ...X invalid
     *
     * @param board char[][]
     * @return int
     */
    public int countBattleships(char[][] board) {
        int m = board.length;
        if (m == 0) return 0;
        int n = board[0].length;
        
        int count = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (board[i][j] == '.') continue;
                if (i > 0 && board[i - 1][j] == 'X') continue;
                if (j > 0 && board[i][j - 1] == 'X') continue;
                count++;
            }
        }
        return count;
    }
    
    public int countBattleships2(char[][] board) {
        int count = 0;
        for (int i = 0; i < board.length; i++) {
            for (int j = 0; j < board[0].length; j++) {
                if (board[i][j] == 'X' && (i == 0 || board[i - 1][j] == '.')
                        && (j == 0 || board[i][j - 1] == '.')) {
                    count++;
                }
            }
        }
        return count;
    }
    
    /**
     * 503. Next Greater Element II
     * 找出下一个比当前元素大的元素,不存在输出-1
     * [1,2,1] -> [2, -1, 2]
     *
     * @param nums int[] 环形数组,有重复 The length of given array won't exceed 10000.
     * @return int[]
     */
    public int[] nextGreaterElements(int[] nums) {
        int len = nums.length;
        int[] arr = new int[len * 2];
        System.arraycopy(nums, 0, arr, 0, len);
        System.arraycopy(nums, 0, arr, len, len);
        
        Map<Element, Integer> map = new HashMap<>();
        for (int i = 0; i < len; i++) {
            int n = nums[i];
            int next = n;
            for (int j = i + 1; j < (i + len); j++) {
                if (arr[j] > next) {
                    next = arr[j];
                    break;
                }
            }
            map.put(new Element(i, n), next > n ? next : -1);
        }
        
        int[] res = new int[len];
        for (int i = 0; i < len; i++) {
            res[i] = map.get(new Element(i, nums[i]));
        }
        return res;
    }
    
    private static class Element {
        private int index;
        private int value;
        
        public Element(int index, int value) {
            this.index = index;
            this.value = value;
        }
        
        @Override
        public boolean equals(Object o) {
            if (this == o) return true;
            if (o == null || getClass() != o.getClass()) return false;
            
            Element element = (Element) o;
            
            if (index != element.index) return false;
            return value == element.value;
            
        }
        
        @Override
        public int hashCode() {
            int result = index;
            result = 31 * result + value;
            return result;
        }
    }
    
    /**
     * 442. Find All Duplicates in an Array
     * <p>
     * 1 ≤ a[i] ≤ n (n = size of array),
     * 有些数字出现两次,有些出现一次
     * <p>
     * without extra space and in O(n) runtime
     *
     * @param nums int[]
     * @return List<integer>
     */
    public List<Integer> findDuplicates(int[] nums) {
        List<Integer> result = new ArrayList<>();
        int[] arr = new int[nums.length];
        for (int n : nums) {
            if (arr[n - 1] == 0) {
                arr[n - 1] = n;
            } else {
                result.add(n);
            }
        }
        return result;
    }
    
